// draws the contents of the decoded uint8_t array to the screen and then writes the connected network, IP, and displaymessage

int JPEGDraw(JPEGDRAW* pDraw)
{
  gfx.waitDMA();
  gfx.setAddrWindow(pDraw->x, pDraw->y, pDraw->iWidth, pDraw->iHeight);
  gfx.pushPixelsDMA((uint16_t* )pDraw->pPixels, pDraw->iWidth * pDraw->iHeight, true);
  return 1;
}

void updateIPAddress()
{
  gfx.startWrite();
  //gfx.drawJpg(decodedData, decodedSize, 0, 0, gfx.width(), gfx.height(), 0, 0, 1, 1, top_left);
  gfx.setCursor(15,15);
  gfx.print(WiFi.SSID());
  gfx.print("  ");
  gfx.print(WiFi.localIP());
  gfx.print("  ");
  gfx.print(DisplayMessage);
  gfx.endWrite();
}

